INSERT INTO `ey_article_content` VALUES ('1', '7', '&lt;div class=&quot;nsArea-medium&quot; style=&quot;margin: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;div class=&quot;conArea&quot; style=&quot;margin: 0px; padding: 0px; border: 0px;&quot;&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;&quot;&gt;职位信息：&lt;br/&gt;职位名称：采购经理（全职）&amp;nbsp;&lt;br/&gt;薪资待遇：底薪+提成方式（薪水具有竞争力，并提供多种灵活小福利），试用期80%，三个月转正&lt;br/&gt;学&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 历：大专及以上&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 招聘人数：1人&lt;br/&gt;工作经验：1-3年 （应届生亦可）&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 工作地点：深圳/宝安&amp;nbsp;&lt;br/&gt;年　　龄：不限&lt;br/&gt;&amp;nbsp;&lt;br/&gt;岗位职责：&lt;br/&gt;1，能针对陌生型号寻找原厂代理等优质供应商，能分析芯片的市场状况，和供应商谈判获取更好的采购价格。&lt;br/&gt;2、针对销售提交的询盘bom快速专业核实价格并报价。&lt;br/&gt;3、主动开发芯片供应商，扩大公司芯片经营范围和增加公司竞争优势。&lt;br/&gt;4、完成公司所承接订单的采购工作，以及公司备货的采购工作。&lt;br/&gt;5、及时更新供应商所反馈和自己所掌握的市场情况，为公司备货提供建议。&lt;br/&gt;&amp;nbsp;&lt;br/&gt;任职资格：&lt;br/&gt;1、正规院校大专毕业，英语能看懂芯片规格书。男女不限，欢迎优秀相关专业的应届生投递简历。&lt;br/&gt;2、熟悉网络操作，电脑操作，办公软件操作。&lt;br/&gt;3、积极主动，能承受工作压力。&lt;br/&gt;4、有芯片采购工作经验者优先，有优质芯片供应商资源者优先&lt;br/&gt;&amp;nbsp;&lt;br/&gt;工作时间：&lt;br/&gt;5天半（9:00~18:00 ） 周六下午和周日休息。&lt;br/&gt;&amp;nbsp;&lt;br/&gt;联系方式：&lt;br/&gt;联 系 人：孙先生&lt;br/&gt;联系电话：0755-23141725&lt;br/&gt;邮&amp;nbsp;&amp;nbsp;&amp;nbsp; 箱：&lt;a href=&quot;mailto:sunxingdao@126.com&quot; style=&quot;text-decoration-line: none; outline: none; color: rgb(0, 125, 198);&quot;&gt;sunxingdao@126.com&lt;/a&gt;（简历接受邮箱）&lt;br/&gt;工作地点：宝安西乡劳动路宝捷安经贸中心1303 -1305室&lt;/p&gt;&lt;/div&