INSERT INTO `ey_article_content` VALUES ('20', '28', '', '', '1661224654', '1661224654');
INSERT INTO `ey_article_content` VALUES ('21', '40', '&lt;p&gt;本课程综合讲述了计算机视觉的基本技术原理及其开发和应用。完成本课程的学习，要求学生掌握的主要内容有：&lt;/p&gt;&lt;p&gt;1) 理解图像的形成过程与图像处理的基本技术。其中，图像的形成过程包括：成像、照明、采样、等；图像处理的基本技术包括滤波、形态学操作、图像金字塔、几何变换等。&lt;/p&gt;&lt;p&gt;2) 学习特征检测与匹配的主流技术，包括：特征描述子、特征匹配、边缘检测、Hough变换等。能够在计算机视觉系统的开发中加以运用。&lt;/p&gt;&lt;p&gt;3) 掌握图像分割的基本技术原理和在实际应用中灵活使用的能力，包括：活动轮廓模型、分水岭、基于图的分割、均值移位等技术。&lt;/p&gt;&lt;p&gt;4) 掌握相机配准和运动估计的基本技术原理，并学会灵活运用这些技术，包括：基于特征的配准、姿态估计、相机参数标定、三角测量、参数化运动、光流、层次运动等。&lt;/p&gt;&lt;p&gt;5) 掌握计算摄影学的基本技术，包括：光度学标定、高动态范围成像、超分辨率和去模糊、图像抠图与图像合成、图形拼接、纹理分析与合成等。&lt;/p&gt;&lt;p&gt;6) 了解和掌握3D重建的基本技术。&lt;/p&gt;&lt;p&gt;7) 掌握物体检测与识别的基本技术。&lt;/p&gt;&lt;p&gt;8) 能够借助主流的计算机视觉开源算法框架（如OpenCV）进行计算机视觉系统的开发。&lt;/p&gt;', '', '1662727308', '1662727308');
INSERT INTO `ey_article_content` VALUES ('22', '41', '&lt;p&gt;本课程综合讲述了计算机视觉的基本技术原理及其开发和应用。完成本课程的学习，要求学生掌握的主要内容有：&lt;/p&gt;&lt;p&gt;1) 理解图像的形成过程与图像处理的基本技术。其中，图像的形成过程包括：成像、照明、采样、等；图像处理的基本技术包括滤波、形态学操作、图像金字塔、几何变换等。&lt;/p&gt;&lt;p&gt;2) 学习特征检测与匹配的主流技术，包括：特征描述子、特征匹配、边缘检测、Hough变换等。能够在计算机视觉系统的开发中加以运用。&lt;/p&gt;&lt;p&gt;3) 掌握图像分割的基本技术原理和在实际应用中灵活使用的能力，包括：活动轮廓模型、分水岭、基于图的分割、均值移位等技术。&lt;/p&gt;&lt;p&gt;4) 掌握相机配准和运动估计的基本技术原理，并学会灵活运用这些技术，包括：基于特征的配准、姿态估计、相机参数标定、三角测量、参数化运动、光流、层次运动等。&lt;/p&gt;&lt;p&gt;5) 掌握计算摄影学的基本技术，包括：光度学标定、高动态范围成像、超分辨率和去模糊、图像抠图与图像合成、图形拼接、纹理分析与合成等。&lt;/p&gt;&lt;p&gt;6) 了解和掌握3D重建的基本技术。&lt;/p&gt;&lt;p&gt;7) 掌握物体检测与识别的基本技术。&lt;/p&gt;&lt;p&gt;8) 能够借助主流的计算机视觉开源算法框架（如OpenCV）进行计算机视觉系统的开发。&lt;/p&gt;', '', '1662727301', '1662727301');
