INSERT INTO `ey_sql_cache_table` VALUES ('1', 'ArchivesMaxID', '94', '494a17e43cff13eeb4b9c9837c29026c', 'SELECT MAX(aid) AS tp_max FROM `ey_archives` LIMIT 1', '1666768364', '1666871179');
INSERT INTO `ey_sql_cache_table` VALUES ('3', '|article|1|60|', '4', 'a2f2779a9125ee112a119a61ffbd7e15', 'SELECT COUNT(aid) AS tp_count FROM `ey_archives` `a` WHERE  `a`.`typeid` IN (60)  AND `a`.`channel` = 1  AND `a`.`lang` = \'cn\'  AND `a`.`is_del` = 0  AND (  (a.users_id = 0 OR (a.users_id > 0 AND a.arcrank >= 0)) ) LIMIT 1', '1666768411', '1666871179');
INSERT INTO `ey_sql_cache_table` VALUES ('6', '|model|all|count|', '{\"1\":{\"channel\":1,\"total\":47},\"6\":{\"channel\":6,\"total\":1}}', 'd5ac17fe5649c6d04f4b174c42f2d535', 'SELECT channel, count(aid) as total FROM `ey_archives` WHERE  `lang` = \'cn\'  AND `status` = 1  AND `is_del` = 0  AND (  (users_id = 0 OR (users_id > 0 AND arcrank >= 0)) ) GROUP BY `channel`', '1668228166', '1668228166');
INSERT INTO `ey_sql_cache_table` VALUES ('7', '|arctype|all|count|', '{\"48\":{\"typeid\":48,\"num\":6},\"49\":{\"typeid\":49,\"num\":17},\"50\":{\"typeid\":50,\"num\":10},\"51\":{\"typeid\":51,\"num\":2},\"52\":{\"typeid\":52,\"num\":6},\"53\":{\"typeid\":53,\"num\":2},\"60\":{\"typeid\":60,\"num\":4}}', '733d8dc1ba956fa962c607876acf3ec4', 'SELECT typeid, count(typeid) as num FROM `ey_archives` WHERE  `channel` IN (1,2,3,4,5,7,51,101,102)  AND `lang` = \'cn\'  AND `is_del` = 0  AND (  (users_id = 0 OR (users_id > 0 AND arcrank >= 0)) ) GROUP BY `typeid`', '1668228212', '1668228212');
