INSERT INTO `ey_zlxz_content` VALUES ('1', '21', '1661179898', '1661179898', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; border: 0px; text-indent: 2em; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;2010年全球IC卡市场，亚太地区约占71.5%的市场份额，其中中国市场占据全球IC卡销售收入的三分之一。IC卡在电信领域中的应用市场份额在70%以上。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; border: 0px; text-indent: 2em; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;2010年中国智能卡销售量为21.35亿张，同比增长8.4%；中国IC卡片销售额约81亿元，同比增长13%。在传统领域，二代身份证已经基本发放完毕；在移动通信市场， 2010年中国移动通信卡销售量同比增长3.2%。在新兴应用领域，如全国统一社保卡、手机支付卡等，市场增长迅猛。2010年中国社保卡销量增长高达126.3%。社保卡市场将成为继二代身份证之后的又一重量级智能卡应用。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; border: 0px; text-indent: 2em; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 中国本土智能芯片上游提供商主要包括：大唐微电子、复旦微电子、同方微电子（2011年被晶源电子收购）和上海华虹等。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; border: 0px; text-indent: 2em; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2010年中国智能卡市场中，握奇数据智能卡销售收入接近13亿元，占15.9%的份额；金雅拓销售收入约10.15亿元，占12.5%；东信和平和恒宝股份智能卡销售收入分别为8.52亿元和5.81亿元，分别占10.5%和7.2%。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; border: 0px; text-indent: 2em; color: rgb(34, 34, 34); font-family: &amp;quot;Microsoft YaHei&amp;quot;, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 握奇智能卡在电信、金融、交通和政府领域均占有重要的市场地位。电信卡收入占握奇总收入的50%，&lt;br/&gt;IM/USIM卡的供货量占电信运营商总采购量的12%,为中国电信卡市场第四大供货商。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 'http://www.sunnyqi.com/upLoad/product/month_2109/202109080931152534.pdf');
